function[varargout]=autoblksmotorresizeCb(varargin)



    varargout{1}={};

    Block=varargin{1};
    Context=varargin{2};

    switch Context
    case 'Initialization'
        Initialization(Block);
    case 'DrawCommands'
        varargout{1}=DrawCommands(Block);
    case 'resize'
        resizeMotor(Block);
    case 'plotCharacteristics'
        plotCharacteristics(Block);
    case 'plotResults'
        plotResults(Block);
    case 'restoreDefaults'
        restoreDefaults(Block);
    end
end

function IconInfo=DrawCommands(Block)




    IconInfo.ImageName='mapped_motor_generic.png';
    [IconInfo.image,IconInfo.position]=iconImageUpdate(IconInfo.ImageName,1,60,150,'white');

end

function Initialization(Block)


