function resizeMotor(Block)

    clickApplyButton(Block);


    set_param(bdroot,'SimulationCommand','update');


    MethodType=get_param(Block,'MethodType');


    path_mtr=[bdroot,'/Motor System/Motor & Inverter Plant'];
    path_ctrl=[bdroot,'/Motor System/Motor Controller'];

    set_param(path_mtr,'LabelModeActiveChoice',MethodType);
    set_param(path_ctrl,'LabelModeActiveChoice',MethodType);


    switch MethodType
    case 'Mapped Motor Model'
        resizeMotor_mapped(Block);

    case 'Dynamic Motor Model'
        resizeMotor_dynamic(Block);

    case 'Flux-Based PMSM Model'
        resizeMotor_fluxBased(Block);
    end


    clickApplyButton(Block);


    set_param(bdroot,'SimulationCommand','update');
end

function plotCharacteristics(Block)


    set_param(bdroot,'SimulationCommand','update');


    MethodType=get_param(Block,'MethodType');

    switch MethodType
    case 'Mapped Motor Model'
        plotCharacteristics_mapped(Block);

    case 'Dynamic Motor Model'
        Motor=plotCharacteristics_dynamic(Block,1);

    case 'Flux-Based PMSM Model'
        plotFluxTables(Block);
    end

end

function restoreDefaults(Block)

    MethodType=get_param(Block,'MethodType');


    path_mtr=[bdroot,'/Motor System/Motor & Inverter Plant'];
    path_ctrl=[bdroot,'/Motor System/Motor Controller'];

    set_param(path_mtr,'LabelModeActiveChoice',MethodType);
    set_param(path_ctrl,'LabelModeActiveChoice',MethodType);


    switch MethodType
    case 'Mapped Motor Model'
        restoreDefaults_mapped(Block);

    case 'Dynamic Motor Model'
        restoreDefaults_dynamic(Block);

    case 'Flux-Based PMSM Model'
        restoreDefaults_fluxBased(Block);
    end


    clickApplyButton(Block);


    set_param(bdroot,'SimulationCommand','update');
end

