function update_DynoControls(Block,Vdc,T_max,N_max)

    Blk_Tmax=[bdroot,'/Dynamometer Control/Max Torque'];
    Blk_Vdc=[bdroot,'/Dynamometer Control/DC Link Voltage'];
    Blk_Nref=[bdroot,'/Dynamometer Control/Dyno Speed Command'];
    Ts=autolibgeteditparamval(Blk_Nref,'tsamp');


    if(N_max>20000)
        N_start=1000;
        N_increment=1000;
    else
        if(N_max>5000)
            N_start=500;
            N_increment=500;
        else
            N_start=50;
            N_increment=50;
        end
    end


    Nref=[N_start:N_increment:N_max].';
    [a,b]=size(Nref);
    stoptime=round(a*Ts);


    set_param(Blk_Tmax,'value',num2str(T_max));
    set_param(Blk_Nref,'OutValues',mat2str(Nref));
    set_param(Blk_Vdc,'value',num2str(Vdc));
    set_param(bdroot,'stoptime',num2str(stoptime));


    readActiveVariant();
end

function readActiveVariant()


    path_mtr=[bdroot,'/Motor System/Motor & Inverter Plant'];
    path_testBtn=[bdroot,'/Run Performance Tests'];

    MethodType=get_param(path_mtr,'LabelModeActiveChoice');


    switch MethodType
    case 'Mapped Motor Model'
        set_param(path_testBtn,'MaskDisplay','disp(getString(message(''autoblks:autoblkDynoMask:MtrPerformanceTestLabelMapped'')))');

    case 'Dynamic Motor Model'
        set_param(path_testBtn,'MaskDisplay','disp(getString(message(''autoblks:autoblkDynoMask:MtrPerformanceTestLabelDynamic'')))');

    case 'Flux-Based PMSM Model'
        set_param(path_testBtn,'MaskDisplay','disp(getString(message(''autoblks:autoblkDynoMask:MtrPerformanceTestLabelFluxBased'')))');
    end

end

function resizeMotor_fluxBased(Block)

    Blk_Mtr=[bdroot,'/Motor System/Motor & Inverter Plant/Flux-Based PMSM Model/Flux-Based PMSM'];
    Blk_Ctrl=[bdroot,'/Motor System/Motor Controller/Flux-Based PM Controller/Flux-Based PM Controller'];


    P_rated=autolibgeteditparamval(Block,'P_rated');
    Vdc=autolibgeteditparamval(Block,'Vdc');
    Rs=autolibgeteditparamval(Blk_Mtr,'Rs');
    pp=autolibgeteditparamval(Blk_Mtr,'P');


    flux_d=autolibgeteditparamval(Blk_Mtr,'flux_d');
    flux_q=autolibgeteditparamval(Blk_Mtr,'flux_q');
    id_axis=autolibgeteditparamval(Blk_Mtr,'id');
    iq_axis=autolibgeteditparamval(Blk_Mtr,'iq');


    id_index=autolibgeteditparamval(Blk_Ctrl,'id_index');
    iq_index=autolibgeteditparamval(Blk_Ctrl,'iq_index');
    lambda_d=autolibgeteditparamval(Blk_Ctrl,'lambda_d');
    lambda_q=autolibgeteditparamval(Blk_Ctrl,'lambda_q');


    id_ref=autolibgeteditparamval(Blk_Ctrl,'id_ref');
    iq_ref=autolibgeteditparamval(Blk_Ctrl,'iq_ref');
    Trq_mtr=autolibgeteditparamval(Blk_Ctrl,'tbp');
    Spd_mtr=autolibgeteditparamval(Blk_Ctrl,'wbp');

    Kp_d=autolibgeteditparamval(Blk_Ctrl,'Kp_d');
    Kp_q=autolibgeteditparamval(Blk_Ctrl,'Kp_q');
    Ki_d=autolibgeteditparamval(Blk_Ctrl,'Ki_d');
    Ki_q=autolibgeteditparamval(Blk_Ctrl,'Ki_q');

    Is_max=max(iq_index);
    T_max=max(Trq_mtr);


    P_new=autolibgeteditparamval(Block,'P_new');
    Vdc_new=autolibgeteditparamval(Block,'Vdc_new');
    KA=autolibgeteditparamval(Block,'Ka');


    KR=sqrt(P_new/P_rated/KA);
    KW=(Vdc_new/Vdc)/(KR*KA);

    warning_flag=checkConstraints(Block,P_rated,P_new,Vdc,Vdc_new,KA,KR,KW);

    if(warning_flag)
        return;
    end


    Rs_new=round((KW^2/KR^2)*KA*Rs,6);
    I_new=round((KR/KW)*Is_max,4);


    id_axis_new=round((KR/KW)*id_axis,4);
    iq_axis_new=round((KR/KW)*iq_axis,4);
    flux_d_new=round(KA*KR*KW*flux_d,6);
    flux_q_new=round(KA*KR*KW*flux_q,6);


    id_index_new=round((KR/KW)*id_index,4);
    iq_index_new=round((KR/KW)*iq_index,4);
    lambda_d_new=round(KA*KR*KW*lambda_d,6);
    lambda_q_new=round(KA*KR*KW*lambda_q,6);


    Trq_new=round(KR^2*KA*Trq_mtr,4);
    id_ref_new=round((KR/KW)*id_ref,4);
    iq_ref_new=round((KR/KW)*iq_ref,4);

    Kp_d_new=round(KA*(KW^2)*Kp_d,6);
    Kp_q_new=round(KA*(KW^2)*Kp_q,6);
    Ki_d_new=round(KA*((KW/KR)^2)*Ki_d,6);
    Ki_q_new=round(KA*((KW/KR)^2)*Ki_q,6);

    T_max_new=max(Trq_new);




    autolibseteditparamval(Block,'P_rated',P_new);
    autolibseteditparamval(Block,'Vdc',Vdc_new);


    autolibseteditparamval(Blk_Mtr,'Rs',Rs_new);
    autolibseteditparamval(Blk_Mtr,'P',pp);
    autolibseteditparamval(Blk_Ctrl,'PolePairs',pp);


    autolibseteditparamval(Blk_Mtr,'id',id_axis_new);
    autolibseteditparamval(Blk_Mtr,'iq',iq_axis_new);
    autolibseteditparamval(Blk_Mtr,'flux_d',flux_d_new);
    autolibseteditparamval(Blk_Mtr,'flux_q',flux_q_new);


    autolibseteditparamval(Blk_Ctrl,'lambda_d',lambda_d_new);
    autolibseteditparamval(Blk_Ctrl,'lambda_q',lambda_q_new);
    autolibseteditparamval(Blk_Ctrl,'id_index',id_index_new);
    autolibseteditparamval(Blk_Ctrl,'iq_index',iq_index_new);


    autolibseteditparamval(Blk_Ctrl,'id_ref',id_ref_new);
    autolibseteditparamval(Blk_Ctrl,'iq_ref',iq_ref_new);
    autolibseteditparamval(Blk_Ctrl,'tbp',Trq_new);
    autolibseteditparamval(Blk_Ctrl,'wbp',Spd_mtr);

    autolibseteditparamval(Blk_Ctrl,'Kp_d',Kp_d_new);
    autolibseteditparamval(Blk_Ctrl,'Ki_d',Ki_d_new);
    autolibseteditparamval(Blk_Ctrl,'Kp_q',Kp_q_new);
    autolibseteditparamval(Blk_Ctrl,'Ki_q',Ki_q_new);


    autoblksenableparameters(Block,{'Kr','Kw'},{},{},{},true);

    autolibseteditparamval(Block,'Kr',KR);
    autolibseteditparamval(Block,'Kw',KW);

    autoblksenableparameters(Block,{},{'Kr','Kw'},{},{},true);


    N_max=round(max(Spd_mtr)*(60/(2*pi)));
    update_DynoControls(Block,Vdc_new,T_max_new,N_max);


    msgbox(getString(message('autoblks:autoblkDynoMask:MtrMsgBxCfMsg')),...
    getString(message('autoblks:autoblkDynoMask:MtrMsgBxCfTle')),'replace');
end

