end

function Motor=plotCharacteristics_dynamic(Block,EN_Plot)


    Blk_Mtr=[bdroot,'/Motor System/Motor & Inverter Plant/Dynamic PMSM Model/Interior PMSM SS Spd'];
    Blk_Ctrl=[bdroot,'/Motor System/Motor Controller/Interior PM Controller SS Trq/Interior PM Controller SS Trq'];


    P_rated=autolibgeteditparamval(Block,'P_rated');
    Vdc=autolibgeteditparamval(Block,'Vdc');

    Rs=autolibgeteditparamval(Blk_Mtr,'Rs');
    pp=autolibgeteditparamval(Blk_Mtr,'P');
    Ldq=autolibgeteditparamval(Blk_Mtr,'Ldq');
    Ld=Ldq(1);
    Lq=Ldq(2);
    lambda_pm=autolibgeteditparamval(Blk_Mtr,'lambda_pm');

    T_max=autolibgeteditparamval(Blk_Ctrl,'T_max');
    I_max=max(autolibgeteditparamval(Blk_Ctrl,'idq_limits'));


    if Ld==Lq
        Lq=Lq*1.001;
    end



    Vlim=Vdc/sqrt(3);
    Imax=I_max;
    flux=lambda_pm;
    p=pp;

    Kt=T_max/I_max;
    Ich=-flux/Ld;

    ida=flux/4/(Lq-Ld)-sign(Lq-Ld)*sqrt(flux^2/16/(Lq-Ld)^2+Imax^2/2);
    iqa=sqrt(Imax^2-ida^2);
    Tmax=3/2*p*(iqa*flux-(Lq-Ld)*ida*iqa);

    iq_MTPA=linspace(0,iqa,1000);
    id_MTPA=flux/2/(Lq-Ld)-sign(Lq-Ld)*sqrt(flux^2/4/(Lq-Ld)^2+iq_MTPA.^2/2);
    T_MTPA=3/2*p*(iq_MTPA*flux-(Lq-Ld)*id_MTPA.*iq_MTPA);
    T_MTPA_field=3/2*p*(iq_MTPA*flux);


    w_base=Vlim/sqrt((flux+Ld*ida)^2+(Lq*iqa)^2);
    w_c=Vlim/flux;

    N_base_rpm=w_base/(p*2*pi/60);


    id_fw=linspace(ida,-Imax,1000);
    iq_fw=sqrt(Imax^2-id_fw.^2);
    Volim=Vlim-Imax*Rs;
    w_fw=Volim./sqrt((flux+Ld*id_fw).^2+(Lq*iq_fw).^2);
    T_fw_lim=3/2*p*(iq_fw*flux-(Lq-Ld).*id_fw.*iq_fw);
    T_fw_lim_field=3/2*p*(iq_fw*flux);

    spdPts=[0,w_fw];
    rpmPts=spdPts/2/pi*60/p;
    TrqPts=[Tmax,T_fw_lim];

    iqa_actual=Tmax/Kt;
    ida_actual=flux/2/(Lq-Ld)-sqrt(flux^2/4/(Lq-Ld)^2+iqa_actual^2);
    Imax2=sqrt(iqa_actual^2+ida_actual^2);


    Motor.N_base=N_base_rpm;
    Motor.N_max=round(max(rpmPts));
    Motor.T_max=T_max;
    Motor.T_fw_lim=T_fw_lim;
    Motor.I_max=I_max;


    if(EN_Plot)


        close all


        subplot(1,2,1);
        hold on;grid on;
        plot(rpmPts,TrqPts);
        title('Torque-Speed Characteristics');
        xlabel('Speed (rpm)');ylabel('Torque (N*m)');

        axis auto;
        scale=axis;
        axis([scale(1:2),0,1.5*scale(4)]);

        legend1=['Peak Torque at V_{dc} = ',num2str(Vdc),' V; ','I_{max} = ',char(vpa(Imax,2)),' A'];
        legend(legend1);

        subplot(1,2,2);
        hold on;grid on;
        plot(id_MTPA,iq_MTPA,'r','linewidth',2);
        theta=linspace(0,2*pi,500);
        IlimId=I_max*cos(theta);
        IlimIq=I_max*sin(theta);
        plot(IlimId,IlimIq,'b');

        w_m=N_base_rpm*2*pi/60;
        w_e=p*w_m;

        VlimId=-flux/Ld+(1/Ld*Vlim/w_e)*cos(theta);
        VlimIq=1/Lq*Vlim/w_e*sin(theta);
        plot(VlimId,VlimIq,'g-');

        title('i_{dq} plane')
        xlabel('i_d (A)');ylabel('i_q (A)');

        axis equal;axis auto;
        scale=axis;
        axis([1.2*scale(1),-1.2*scale(1),scale(3:4)]);

        xline(0);
        yline(0);

        legend1=['Maximum torque per ampere trajectory'];
        legend2=['Current limit circle; I_{max} = ',char(vpa(Imax,2)),' A'];
        legend3=['Voltage limit ellipse; V_{dc} = ',num2str(Vdc),' V,',' \omega = ',num2str(round(N_base_rpm)),' rpm'];

        legend(legend1,legend2,legend3);

        hold off;
    end

end

function warning_flag=checkConstraints_mapped(Block,P_rated,P_new,Vdc,Vdc_new,T_rated,T_rated_new,N_max,N_max_old)


    warning_flag=false;


    if((P_rated==P_new)...
        &&(Vdc==Vdc_new)...
        &&(T_rated==T_rated_new)...
        &&(abs(N_max_old-N_max)<10))

        ERRORSTRING=getString(message('autoblks:autoblkErrorMsg:errCheckInputs'));
        DLGNAME=getString(message('autoblks:autoblkDynoMask:MtrMsgBxCfTle'));
        errordlg(ERRORSTRING,DLGNAME);
        warning_flag=true;
        return;
    end


    upper_bound=10;
    lower_bound=1/upper_bound;

    ratio_power=P_new/P_rated;
    ratio_voltage=Vdc_new/Vdc;
    ratio_torque=T_rated_new/T_rated;

    if(~warning_flag)
        warning_flag=checkConstraints_range(ratio_power,lower_bound,upper_bound);
    end

    if(~warning_flag)
        warning_flag=checkConstraints_range(ratio_voltage,lower_bound,upper_bound);
    end

    if(~warning_flag)
        warning_flag=checkConstraints_range(ratio_torque,lower_bound,upper_bound);
    end


end

function warning_flag=checkConstraints(Block,P_rated,P_new,Vdc,Vdc_new,KA,KR,KW)


    warning_flag=false;

    if(P_rated==P_new&&Vdc==Vdc_new)
        ERRORSTRING=getString(message('autoblks:autoblkErrorMsg:errCheckInputs'));
        DLGNAME=getString(message('autoblks:autoblkDynoMask:MtrMsgBxCfTle'));
        errordlg(ERRORSTRING,DLGNAME);

        warning_flag=true;
        return;
    end


    if(P_new>P_rated)

        if(KA<=1)
            ERRORSTRING=getString(message('autoblks:autoblkErrorMsg:errAxialResizeIncrease'));
            DLGNAME=getString(message('autoblks:autoblkDynoMask:MtrMsgBxCfTle'));
            errordlg(ERRORSTRING,DLGNAME);

            warning_flag=true;
            return;
        end

        if(KR<=1)
            ERRORSTRING=getString(message('autoblks:autoblkErrorMsg:errRadialResize'));
            DLGNAME=getString(message('autoblks:autoblkDynoMask:MtrMsgBxCfTle'));
            errordlg(ERRORSTRING,DLGNAME);

            warning_flag=true;
            return;
        end

    end


    if(P_new<P_rated)

        if(KA>=1)
            ERRORSTRING=getString(message('autoblks:autoblkErrorMsg:errAxialResizeDecrease'));
            DLGNAME=getString(message('autoblks:autoblkDynoMask:MtrMsgBxCfTle'));
            errordlg(ERRORSTRING,DLGNAME);

            warning_flag=true;
            return;
        end

        if(KR>=1)
            ERRORSTRING=getString(message('autoblks:autoblkErrorMsg:errRadialResize'));
            DLGNAME=getString(message('autoblks:autoblkDynoMask:MtrMsgBxCfTle'));
            errordlg(ERRORSTRING,DLGNAME);

            warning_flag=true;
            return;
        end

    end


    upper_bound=10;
    lower_bound=1/upper_bound;

    ratio_power=P_new/P_rated;
    ratio_voltage=Vdc_new/Vdc;

    if(~warning_flag)
        warning_flag=checkConstraints_range(ratio_power,lower_bound,upper_bound);
    end

    if(~warning_flag)
        warning_flag=checkConstraints_range(ratio_voltage,lower_bound,upper_bound);
    end

end

function warning_flag=checkConstraints_range(ratio,lower_bound,upper_bound)

    warning_flag=false;

    if((ratio>upper_bound)||(ratio<lower_bound))

        ERRORSTRING=getString(message('autoblks:autoblkErrorMsg:errMotRange'));
        DLGNAME=getString(message('autoblks:autoblkDynoMask:MtrMsgBxCfTle'));
        errordlg(ERRORSTRING,DLGNAME);

        warning_flag=true;
    end

end

function Motor=getMotorPlotsCb(P_rated,T_rated,N_max,bp)












    N_base=double(uint32(P_rated/(T_rated*(2*pi/60))));

    N=1:N_max;
    T_max=P_rated./((2*pi/60).*N);
    T_max(1:N_base)=T_rated*ones(1,N_base);
    P=2*pi.*N.*T_max/60;



    Speed_idx=linspace(0,N_max,bp-1);
    Speed_bp=zeros(1,bp);
    idx=length(find(Speed_idx<=N_base));

    Speed_bp(1:idx)=Speed_idx(1:idx);
    Speed_bp(idx+1)=N_base;
    Speed_bp(idx+2:end)=Speed_idx(idx+1:end);

    Motor.Spd_bp=Speed_bp;
    Motor.Trq_bp=zeros(1,bp);
    Motor.Pwr_bp=zeros(1,bp);
    Motor.N_base=N_base;

    for idx=1:bp
        if Speed_bp(idx)==0
            Motor.Trq_bp(idx)=T_max(1);
            Motor.Pwr_bp=P(1);
        else
            Motor.Trq_bp(idx)=T_max(uint32(Speed_bp(idx)));
            Motor.Pwr_bp(idx)=P(uint32(Speed_bp(idx)));
        end

    end

end

